export default function FeedCard({update}) {
    update = update || {
        title: 'News Title'
    }
    return(
        <div className="flex flex-column card shadow bg-white border-t-4 border-c1 ml-4 pl-1 text-left">
            <h3 className="text-2xl text-c1 font-f1 font-semibold">{update.title}</h3>
        </div>
    )
}
